import 'package:sleep/data/models/data.dart';class Seans{  String id;  DateTime startTime;  DateTime endTime;  List<Data> datas;  Seans({required this.id, required this.startTime, required this.endTime, required this.datas});  factory Seans.fromJson(Map<String, dynamic> json) {    return Seans(      id: json['id'],      startTime: DateTime.parse(json['startTime']),      endTime: DateTime.parse(json['endTime']),      datas: json['datas'] != null ? (json['datas'] as List).map((i) => Data.fromJson(i)).toList() : [],    );  }  Map<String, dynamic> toJson() {    return {      'id': id,      'startTime': startTime.toIso8601String(),      'endTime': endTime.toIso8601String(),      'datas': datas.map((e) => e.toJson()).toList(),    };  }}